Wire Hangers creator/hard-rock musician, Alan Robert, is back for blood with an all-new horror comic series, titled Crawl to Me. The story centers on Ryan, as he struggles to protect his family from what appears to be an evil entity living within their basements crawl space. It is only after a series of violent events occur, when Ryan realizes he must set aside all he believes to be true in order to face his shocking and inevitable reality. This intense thriller will keep you guessing every step of the way.
